import React from "react";

const styles = {
  cardTitle: { backgroundColor: "darkgray" },
  cardWidth: { width: "30%" }
};

var ProductCard = props => {
  return (
    <div className="card text-center" style={styles.cardWidth}>
      <img src={props.image} className="card-img-top" alt="Unable to load" />
      <div className="card-body">
        <div class="card-img-overlay" style={styles.cardTitle}>
          <h5 className="card-title text-white text-left">{props.title}</h5>
        </div>
        <p className="card-text">About The Product: {props.description}</p>
        <h6 className="card-title">Price: {props.price}</h6>
        <p class="card-text">
          <small class="text-muted">Items In Stock: {props.quantity}</small>
        </p>
        <a href="/" className="btn btn-info">
          More Info
        </a>
      </div>
    </div>
  );
};

export default ProductCard;
